To decide if S ⇒* t130 t23 t30 t175, we run CYK:

1) Single‐letter cells:
 pos 1:{NT1}  
 pos 2:{NT3,NT11,NT12,NT15}  
 pos 3:{NT1,NT8,NT10,NT22}  
 pos 4:{NT10,NT15,NT19}

2) Length 2 spans:
 [1–2]: from NT1·NT11 via NT2→NT1 NT11 ⇒ {NT2}  
 [2–3]: combines {NT3,11,12,15}·{NT1,8,10,22} ⇒ {NT19,NT9,NT20,NT16,NT22}  
 [3–4]: combines {NT1,8,10,22}·{NT10,15,19} ⇒ {NT6}

3) Length 3 spans:
 [1–3]: tries {NT1}·{…} and {NT2}·{…} ⇒ ∅  
 [2–4]: tries {…}·{NT6} and {…}·{…} ⇒ ∅

4) Full span [1–4]:
 splits 1|3 gives ∅, 2|2 gives (NT2·NT6) ⇒ NT15, 3|1 gives ∅.

So the only nonterminal over the whole string is NT15, not S. Hence S does _not_ derive t130 t23 t30 t175.  

